mapper.insert:
		insert into TC_SpvProductReturnMoney

			,Id
			,MemberId
			,SpvId
			,ProductId
			,TransactionNumber
			,PayPlantformNumber
			,ProductName
			,ProductCode
			,DistributePrincipal
			,DistributeInterest
			,DistributeAmount
			,InterestRateDate
			,PaymentDate
			,ActualExpirationDate
			,ExpectedProfitRatio
			,ActualProfitRatio
			,SpvServiceFee
			,SpvServiceFeeRatio
			,BusinessCheckStatus
                ,CheckingTime
			,CheckingStatus
			,IntoObjectStatus
                ,IntoObjectTime
			,Remark

		values

			,${id}
			,${memberId}
			,${spvId}
			,${productId}
			,#{transactionNumber}
			,#{payPlantformNumber}
			,#{productName}
			,#{productCode}
			,${distributePrincipal}
			,${distributeInterest}
			,${distributeAmount}
			,#{interestRateDate}
			,#{paymentDate}
			,#{actualExpirationDate}
			,${expectedProfitRatio}
			,${actualProfitRatio}
			,${spvServiceFee}
			,${spvServiceFeeRatio}
			,${businessCheckStatus}
            	,#{checkingTime}
			,${checkingStatus}
			,${intoObjectStatus}
            	,#{intoObjectTime}
			,#{remark}


			  select LAST_INSERT_ID() as generatedKey

